import 'dart:typed_data';

import 'package:shared_preferences/shared_preferences.dart';

const String defaultPhotoPath =
    'data:image/png;base64,';
const String baseUrl = "https://task.teamrabbil.com/api/v1";
const Map<String, String> requestHeader = {"Content-Type": "application/json"};

Future<void> writeUserData(userData) async {
  final SharedPreferences prefs = await SharedPreferences.getInstance();

  await prefs.setString('token', userData['token']);
  await prefs.setString('email', userData['data']['email']);
  await prefs.setString('firstName', userData['data']['firstName']);
  await prefs.setString('lastName', userData['data']['lastName']);
  await prefs.setString('mobile', userData['data']['mobile']);
  await prefs.setString('photo', userData['data']['photo']);
}

Future<void> writeEmailVerification(verifyEmail) async {
  final SharedPreferences prefs = await SharedPreferences.getInstance();
  await prefs.setString('verifyEmail', verifyEmail);
}

Future<void> writeOTPVerification(otp) async {
  final SharedPreferences prefs = await SharedPreferences.getInstance();
  await prefs.setString('otp', otp);
}

Future<String?> readUserData(key) async {
  final SharedPreferences prefs = await SharedPreferences.getInstance();
  String? myData = await prefs.getString(key);
  return myData;
}

showBase64Img(base64String) {
  UriData? data = Uri.parse(base64String).data;
  Uint8List myImgPath = data!.contentAsBytes();
  return myImgPath;
}

logOut() async {
  final SharedPreferences prefs = await SharedPreferences.getInstance();
  prefs.clear();
}
